import React from 'react'
import SectionHeader from './SectionHeader'
import data from "../projectData"


export default function ProjectCards() {

    const projects = data.map((item) => {
        return < ProjectCards
            key={projects.id}
            item={projects}
        />

    })

    return (
        <div className='projectsContainer'>
            <SectionHeader
                heading="Projects"
            />
            <section>
                {projects}
            </section>


        </div>
    )
}
